test.tcrossprod.1340 <- function() assertThat(tcrossprod(structure(1:3, .Dim = c(3L, 1L), .Dimnames = structure(list(    x = c("a", "b", "c"), y = NULL), .Names = c("x", "y"))),     structure(1:3, .Dim = c(3L, 1L))), identicalTo(structure(c(1, 2, 3, 2, 4, 6, 3, 6, 9), .Dim = c(3L, 3L), .Dimnames = structure(list(    x = c("a", "b", "c"), NULL), .Names = c("x", "")))))
test.tcrossprod.1341 <- function() assertThat(tcrossprod(structure(1:3, .Dim = c(3L, 1L), .Dimnames = structure(list(    x = c("a", "b", "c"), y = NULL), .Names = c("x", "y"))),     structure(1:3, .Dim = c(3L, 1L), .Dimnames = list(c("a",     "b", "c"), NULL))), identicalTo(structure(c(1, 2, 3, 2, 4, 6, 3, 6, 9), .Dim = c(3L, 3L), .Dimnames = structure(list(    x = c("a", "b", "c"), c("a", "b", "c")), .Names = c("x", "")))))
test.tcrossprod.1342 <- function() assertThat(tcrossprod(structure(1:3, .Dim = c(3L, 1L), .Dimnames = structure(list(    x = c("a", "b", "c"), y = NULL), .Names = c("x", "y"))),     structure(1:3, .Dim = c(3L, 1L), .Dimnames = structure(list(        x = c("a", "b", "c"), y = NULL), .Names = c("x", "y")))), identicalTo(structure(c(1, 2, 3, 2, 4, 6, 3, 6, 9), .Dim = c(3L, 3L), .Dimnames = structure(list(    x = c("a", "b", "c"), x = c("a", "b", "c")), .Names = c("x", "x")))))
